import React from 'react';
import './styles/Teacher.css';

function Teacher() {
  return (
    <div className="teacher-container">
      <h1>Welcome Teacher</h1>
      <p>You can perform CRUD operations here:</p>
      <ul>
        <li>Create new questions</li>
        <li>Read existing questions</li>
        <li>Update existing questions</li>
        <li>Delete existing questions</li>
      </ul>
      <h>Development in Process!</h>
    </div>
  );
}

export default Teacher;
